import mongo from "mongodb"
let conncetion_string = "mongodb+srv://admin:admin@cluster0.6drawhd.mongodb.net/?retryWrites=true&w=majority";
let client = new mongo.MongoClient(conncetion_string,{
    useNewUrlParser:true,
    useUnifiedTopology:true 
})
let db = null
export default () => {
    return new Promise ((resolve, reject)=> {
        if(db && client.isConnceted()){

            resolve(db)
        }

        client.connect(err=> {
            if (err) {

                reject("doslo je do greske prilikom spajanja" + err)
            }
            else {
                console.log("Uspjesno povezivanje na mongo!")
                let db = client.db("apartment")
                resolve(db )
            }
        })
    })   
}

